    //                     'users': users,
    //                     'menu': menu,
    //                     'footer': footer,
    //                 }
    //             )
    //         }).catch(error => console.log(error))
    // }

    render() {
        return (
            <div>
                <div><MenuList menu={this.state.menu} /></div>
                <hr></hr>
                <div style={'border: '}><UserList users={this.state.users} /></div>
                <hr></hr>
                <div><FooterList footers={this.state.footer} /></div>
            </div >
        )
    }
}


export default App;
